public static SubClusterState fromString(String x) {
  try {
    return SubClusterState.valueOf(x);
  } catch (Exception e) {
    LOG.error("Invalid SubCluster State value in the StateStore does not"
        + " match with the YARN Federation standard.");
    return null;
  }
}
